  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of this ongoing project is to
  ensure continued operation and maintenance of the HaleNet climate and ecosystem
  monitoring network, including field operations, equipment maintenance and replacement,
  sensor recalibration, data communication improvements, data screening/archival,
  data analysis, and dissemination of results. The high temporal and spatial resolution
  of the data produced by HaleNet are critical to calibration and validation of downscaled
  climate models for Hawaii, and allow attribution of ecological changes to climate
  variables.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
